import HomeIcon from '@material-ui/icons/HomeOutlined';

export default [
  {
    items: [
      {
        title: 'Overview',
        href: '/home',
        icon: HomeIcon
      },
      {
        title: 'Data',
        href: '/data',
        icon: HomeIcon
      },
      {
        title: 'Gallery',
        href: '/gallery',
        icon: HomeIcon
      },
    ]
  }
];
